import React from 'react';
import Calendar from './Calendar'
import UserCreate from './UserCreate';
import Users from './Users';
import { Link } from 'react-router-dom';


class NavBar extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
    return (
        <div className="nav-bar">
          {/* <div className="links">
          <NavLink to="/usercreate" ><p>create user</p></NavLink>
          <NavLink exact to="/users"><p>users</p></NavLink>
          <NavLink exact to="/calendar"><p>calendar</p></NavLink>
          </div>
          <div className="content">
          <Route path="/calendar" component={Calendar}/>
          <Route path="/usercreate" component={UserCreate}/>
          <Route path="/users" component={Users}/>
          </div> */}
          <nav>
              <ul className="links">
                <li><Link to="/"><p>Home</p></Link></li>
                  <li><Link to="/calendar"><p>calendar</p></Link></li>
                  <li><Link to="/usercreate"><p>create user</p></Link></li>
                  <li><Link to="/users"><p>users</p></Link></li>
              </ul>
          </nav>
        </div>

      );
    }
}

export default NavBar;
